import React from 'react';
import ReactDOM from 'react-dom';
import MovieRecommendation from './MovieRecommendation';


const initialMovies = [
    {
        id: 1,
        name: 'Inferno',
        year: 1992,
        rating: 9
    },
    {
        id:2,
        name: "Big daddy",
        year: 2004,
        rating: 7
    }
]

ReactDOM.render(<MovieRecommendation initialMovies={initialMovies} />, document.getElementById('root'));
